description:
Promotional info from comiXology - &quot;The sketchbook of a young artist visiting Amsterdam for the first time. Natalie focuses on drawing the people she sees walking and cycling past her on the street, and loves making characters out of real people. This comic includes process notes, a breakdown of the drawing tools used, and several bonus pages from the artist's imagination at the end of the trip--when an exciting new place has set her imagination ablaze!&quot;

This is the digital copy by Son of Ultron-Empire. Please seed and enjoy!

